import './CreatorConnect.css';

//res.header('Access-Control-Allow-Origin', "*")

const STYLE = {
  SPAN:
  {
    fontSize: "1.5em"
  }
}
class Home extends React.Component {
  render() { 
    return (
      <div>
        <h2><span style={STYLE.SPAN}>C</span>reator<span style={STYLE.SPAN}>C</span>onnect</h2>
        <div class="parent">
          <div class="searchBar"><input id="myInput" type="text" onkeyup="searchBar()" placeholder="Search through names and skills..."></input></div>
        </div>

      </div>
      )
  }
}
export default Home
